import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import logo from '../../2132GLogo_500x500.png';
import ProfileMenu from './ProfileMenu';
import './NavBar.css';

const NavBar = ({ links, menuList, isSginedIn }) => {
	const [menuOpen, setMenuOpen] = useState(false);

	const toggleMenu = () => {
		setMenuOpen(!menuOpen);
	};

	const linkMarkup = links.map((link, i) => {
		return (
			<li key={i}>
				<Link to={link.link}>
					<div className='nav-padding'>
						{link.label}
					</div>
				</Link>
			</li>
		);
	});

	const renderProfileMenu = () => {
		return isSginedIn ? (
			<li>
				<div
					onClick={toggleMenu}
					className='nav-padding'
				>
					<div className='profile'>
						<img
							alt='Rodgerâ€™s account'
							src='https://a0.muscache.com/defaults/user_pic-50x50.png?v=3'
						/>
					</div>
				</div>
				<div>
					{menuOpen ? (
						<ProfileMenu
							toggleMenu={toggleMenu}
							menuList={menuList}
						/>
					) : null}
				</div>
			</li>
		) : null;
	};

	return (
		<header id='navbar'>
			<nav>
				<div className='logo nav-items'>
					<Link to='/'>
						<img
							src={logo}
							alt='AirBnB'
							style={{
								height: '55px'
							}}
						/>
					</Link>
				</div>

				<div className='padding'></div>

				<div className='nav-links nav-items'>
					<ul className='nav-menu'>
						{linkMarkup}
						{renderProfileMenu}
					</ul>
				</div>
			</nav>
		</header>
	);
};

export default NavBar;
